import React, { Component } from 'react';
import { Header, Content } from './components/header/header'
import './App.css';

class App extends Component {

  constructor(props)
  {
     super(props);
     this.state = {Counter: 1}
  }

  updateCount = () => {
     this.setState({Counter: this.state.Counter + 1})
  }

  render(){
   setTimeout(() => {
      this.updateCount();
   }, 1000);
    return(
       <div>
          <h1>Hello World</h1>
          <p data-myattribute = "somevalue">{this.state.Counter}</p>
          <Header></Header>
          <Content text="Paragraph"></Content>
          <ContentFunctional text="text"></ContentFunctional>
       </div>
    );
 }
}

export default App;
